import React from 'react'
// import work1 from './images/work 1.png'
// import work2 from './images/work 2.png'
// import work3 from './images/work 3.png'
import Footer from './Footer'
import $ from 'jquery'
import { Helmet } from 'react-helmet'

const AffiliateHome = () => {
    // total
    $(function () {
        var fx = function fx() {
        $(".stat-number").each(function (i, el) {
            var data = parseInt(this.dataset.price, 10);
            var props = {
                "from": {
                    "count": 0
                },
                    "to": { 
                    "count": data
                }
            };
            $(props.from).animate(props.to, {
                duration: 2000 * 1,
                step: function (now, fx) {
                    $(el).text(Math.ceil(now));
                },
                complete:function() {
                    if (el.dataset.sym !== undefined) {
                      el.textContent = el.textContent.concat(el.dataset.sym)
                    }
                }
            });
        });
        };
        
        var reset = function reset() {
            //console.log($(this).scrollTop())
            if ($(this).scrollTop() > 350) {
                $(this).off("scroll");
              fx()
            }
        };
        
        $(window).on("scroll", reset);
    });
    // scroll from top 
    return (
        <>
            <Helmet>
                <title>Earn Money with Affiliate Web Hosting | Hosters.pk</title>
                <meta
      name='Earn Money with Affiliate Web Hosting | Hosters.pk'
      content="Make your passive income source with our affiliate web hosting plans. Get conencted and let's grow together by mutual earning."
    keywords="
    affiliate web hosting,
    cheap affiliate web hosting services,
    cheap affiliate web hosting,
    cheap affiliate web hosting in pakistan,
    cheap affiliate web hosting for small business,
    cheap affiliate web hosting services,
    cheap affiliate web hosting and domain,
    cheap affiliate web hosting in pakistan 2022"
                >
    </meta>
            </Helmet>
            <main>
            {/* heading  */}
            <section className="p-5 blogBg">
                <div className="text-center container text-light fw-bolder">
                    <h1 className="fw-bolder display-4"> Affiliate </h1>
                    <hr className="mx-5 px-5"/>
                </div>
            </section>
            {/* main  */}
            <section className="my-5 container">
